import { createSlice } from "@reduxjs/toolkit";

const ListSlice = createSlice({
    name : "list",
    initialState : {list: []},
    reducers:{
        insert:(state,action)=>{
            state.push(action.payload)
        }
    }
})
export const {insert} = ListSlice.actions
export default ListSlice.reducer
